import './App.css';
import axios from 'axios';

function App() {
  return (
    <div className="App">
        <div className="container">
            <h2>Products</h2>
            <table>
              <tr>
                <th>Firstname</th>
                <th>Lastname</th>
              </tr>
              <tr>
                <td>Peter</td>
                <td>Griffin</td>
              </tr>
              <tr>
                <td>Lois</td>
                <td>Griffin</td>
              </tr>
            </table>
        </div>
    </div>
  );
}

export default App;
